import React, { useState, useEffect } from "react";
import Main from "../components/Main";
import useFetch from "../useFetch";

function Home({ drawerWidth }) {
  const [todos] = useFetch();

  return <Main drawerWidth={drawerWidth} todos={todos} />;
}

export default Home;
